import React from 'react'

function LoginPage() {
  return (
    <div>
        <h1>This is Login Page</h1>
        <form>
            <input type='text' name='username' ></input>
            <button type='submit'>Log me in</button>
        </form>
    </div>
  )
}

export default LoginPage
